import Grid from "@mui/material/Unstable_Grid2";
import MenuList from "../Components/MenuList";
import Box from "@mui/material/Box";

function App() {
  return (
    <Box sx={{ flexGrow: 1, padding: "10px 40px" }}>
      <Grid container spacing={3}>
        <Grid xs={2}>
          <MenuList />
        </Grid>
        <Grid xs={7}>
          <Item>xs=8</Item>
        </Grid>
        <Grid xs={3}>
          <Item>xs</Item>
        </Grid>
      </Grid>
    </Box>
  );
}

export default App;
